import React from "react";

const SideMenu = () => (
  <div className="side-manu">
    <span className="side-bar-items">Home</span>
    <span className="side-bar-items">Charts</span>
    <span className="side-bar-items">Categories</span>
  </div>
);
export default SideMenu;
